nfold. Justice faces off against evil. The old stands against the new. And forces of conservatism clash with radicalism.<br>In this virtual world, all our heroes and heroines have acquired a super power through the help of quantum droids  the ability to turn quantum cube energy into any tactical support device they need. From Optical Camouflage to Quantum Barriers, from a detector that alerts you of approaching enemies, to a medical instrument that heals squad mates; anything and everything can be built, by you, and thats not all. You can choose whatever skills you think will help your strategy the most in any battle.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=m3GoqdK2adw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=m3GoqdK2adw\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><br>Weve even created a vertical combat concept. With parkour features including climbing, gliding, and rolling, players can experience vertical battles on a variety of terrain, including mountains, swamps and deserts. In this game, the arena that hosts your battles are not just a huge, flat map, but a world where you can fly in the sky and move underground. We have also created a number of exploration points scattered throughout the world. Here, you can explore temples in the desert with a chance of finding E-Cores to unlock new skills and weapons. Amid mounds of destroyed robots, you can also find gloves that greatly increase your climbing speed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">We hope that Cyber Hunter can bring you a new way to enjoy gaming and that youll love taking part in the sandbox competitions it offers. The game still has room to improve, however, if you experience overheating, slowdowns, occasional rebooting or updates to your device during the game, we would like to apologize in advance and ask for your understanding.<br>We can reassure you that this version does not represent the final quality of the game, but only the beginning of something even more fun. Your valuable suggestions and opinions will be the driving force for the continuous improvement of Cyber Hunter, and your enthusiasm and passion will be the motivation behind our continued efforts.<br>Finally, we would like to express our gratitude to you for downloading and supporting our game. Thank you!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Features: <br> Vivid characters with verisimilar faces <br>With next-generation face shaping art and over a hundred cosmetic designs, distinct and vivid heroes can be created</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> Special skills and tactics <br>Plenty of tactical skills, such as optical camouflage, quantum barriers, invisible force fields, fire support. You can formulate your own tactical system</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> Take to the skies to search for what you need. Become a parkour expert and knock your enemies out in style <br>Glide in the sky, dive into a deep sea, climb and roll, there are lots of parkour moves available to use during fast-paced free combat.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":88,\"align\":\"center\",\"width\":573,\"height\":323} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http: