(98,1,"2019-10-25 17:08:23","2019-10-25 17:08:23","<!-- wp:image {\"id\":109,\"align\":\"center\",\"width\":566,\"height\":319} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/uploads2fcard2fimage2f9911282f86f0b96e-5158-4f71-bff5-5282cb6bf409-16103227544063597548-300x169.jpg\" alt=\"\" class=\"wp-image-109\" width=\"566\" height=\"319\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Resident evil 100MB for Android mobile</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>THIS GAME MAY CONTAIN CONTENT NOT APPROPRIATE FOR ALL AGES,<br>OR MAY NOT BE APPROPRIATE FOR VIEWING AT WORK.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Resident Evil 4 was re-released on Nintendo Switch May 21 (along with the original Resident Evil and Resident Evil 0), making this the perfect time to revisit one of the greatest games of all time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":108,\"align\":\"center\",\"width\":570,\"height\":321} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/uploads2fcard2fimage2f9911262feaa5186c-f931-45d0-833a-f429c1e633b96121962969992413135-300x169.jpg\" alt=\"\" class=\"wp-image-108\" width=\"570\" height=\"321\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Resident Evil 4 is a masterpiece of action horror. Released for the Nintendo GameCube in 2005, this game reshaped the landscape of the genre into what it looks like today.<br>After nearly 15 years, the game still holds up wonderfully. It was given the HD treatment back in 2011 and has since seen released on nearly every major platform including PC, Xbox One, and PlayStation 4, making it accessible to just about anyone who plays video games.<br>The story<br>Resident Evil 4 stars Leon S. Kennedy, a cop-turned-hero who, after surviving the Raccoon City incident of Resident Evil 2, has been dispatched to Spain in search of the presidents kidnapped daughter.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":106,\"align\":\"center\",\"width\":565,\"height\":424} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/residentevil_sc0086076398401962875380-300x225.jpg\" alt=\"\" class=\"wp-image-106\" width=\"565\" height=\"424\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Resident Evil 4 is one of the best and most impactful action horror games of all time<br>The inciting incident is a bit hacky, but what unfolds is an intriguingly terrifying tale full of twists and turns wrapped inside a remarkably gripping environment.<br>The residents of this Spanish village that Leon finds himself in are relentlessly violent. They will stop at (almost) nothing to tear him apart, but they arent zombies like in previous Resident Evil games.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=9_THtQQjfOE\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=9_THtQQjfOE\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> No, they look normal and theyre still alive and much smarter than your average undead.<br>Eventually, you learn that theyve been infected with a monstrous little creature that turns them into zombie-like pawns to a greater evil figure, someone who wants to take control of peoples minds around the world.<br>Leon winds his way through the treacherous village, a sinister castle, and b