(109,1,"2019-10-25 17:29:26","2019-10-25 17:29:26","<!-- wp:image {\"id\":71,\"align\":\"center\",\"width\":245,\"height\":449,\"linkDestination\":\"custom\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><a href=\"http://localhost/Gameroks/wp-content/uploads/2019/10/ae61dafdbf58db105f114df44bb362122848233061733257641.jpg\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/ae61dafdbf58db105f114df44bb362122848233061733257641.jpg\" alt=\"\" class=\"wp-image-71\" width=\"245\" height=\"449\"/></a></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">To Watch Android GamePlay Subscribe My YouTube Channel<br>A thrilling 5v5 MOBA, now featuring a 99-player Battle Royale Mode.<br>Join your friends in a brand new 5v5 MOBA showdown against real human opponents, Mobile Legends: Bang Bang! Choose your favorite heroes and build the perfect team with your comrades-in-arms! 10-second matchmaking, 10-minute battles. Laning, jungling, tower rushing, team battles, all the fun of PC MOBAs and action games in the palm of your hand! Feed your eSports spirit!<br>Mobile Legends: Bang Bang, 2017s brand new mobile eSports masterpiece. Shatter your opponents with the touch of your finger and claim the crown of strongest Challenger!<br>Your phone thirsts for battle!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=ezv-hqhXagI\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=ezv-hqhXagI\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>Features:</strong> <br><strong>1. Classic MOBA Maps, 5v5 Battles</strong> <br>Real-time 5v5 battles against real opponents. Fight over 3 lanes to take the enemys tower. 4 jungle areas. 18 defense towers. 2 Wild Bosses. Complete reproductions of classic MOBA maps. Full-on 5v5, Human vs. Human battles. A triumphant return to genuine MOBA gameplay.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=0hoYEWlnUck\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=0hoYEWlnUck\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>2. Win with Teamwork &amp; Strategy</strong> <br>Block damage, control the enemy, and heal teammates! Choose from Tanks, Mages, Marksmen, Assassins, Supports, etc. to anchor your team or be match MVP! New heroes are constantly being released!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":67,\"align\":\"center\",\"width\":193,\"height\":343} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/latest8094269429432258548-169x300.jpg\" alt=\"\" class=\"wp-image-67\" width=\"193\" height=\"343\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>3. Fair Fights, Carry Your Team to Victory</strong> <br>Just like classic MOBAs, there is no hero training or paying for stats. Winners and losers are decided based on skill and ability on this fair and balanced platform for competitive gaming. Play to Win, not Pay to Win.<br><strong>4. Simple Controls, Easy to Master</strong> <br>With a virtual joystick on the left and skill buttons on the right, 2 fingers are all you need to become a master! Autolock and target sifting allow you to last hit to your hearts content. Never miss! And a convenient tap-to-equip system lets you focus on the thrill of battle!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=JOXFW7zOLaU\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=JOXFW7zOLaU\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>5. 10 Second Matchmaking, 10 Minute Matches</strong> <br>Matchmaking only takes 10 seconds, and battles last 10 minutes, glossing over the quiet early-game leveling up and jumping right into intense battles. Less boring waiting and repetitive farming, and more thrilling action and fist-pumping victories. At any place, at any moment, just pick up your phone, fire up the game, and immerse yourself in heart-pounding MOBA competition.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":68,\"align\":\"center\",\"width\":528,\"height\":433} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/mobile_legends__layla_by_murasaki_hoshi_dbqt3iu-fullview4193105685506152052-300x246.jpg\" alt=\"\" class=\"wp-image-68\" width=\"528\" height=\"433\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>6. Smart Offline AI Assistance</strong> <br>In most MOBAs, a dropped connection means hanging your team out to dry, but with Mobile Legends: Bang Bangs powerful reconnection system, if you get dropped, you can be back in the battle in seconds. And while youre offline, your character will be controlled by our AI system to avoid a 5-on-4 situation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=D3pY7vMr4PY\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=D3pY7vMr4PY\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">PLEASE NOTE! Mobile Legends: Bang Bang is free to download and play, however some game items can also be purchased for real money. If you do not want to use this feature, please set up password protection for purchases in the settings of your Google Play Store app. Also, under our Terms of Service and Privacy Policy, you must be at least 12 years of age to play or download Mobile Legends: Bang Bang.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":72,\"align\":\"center\",\"width\":547,\"height\":308} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://localhost/Gameroks/wp-content/uploads/2019/10/5bdesuzone409220797888711438.-300x169.jpg\" alt=\"\" class=\"wp-image-72\" width=\"547\" height=\"308\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><strong>Contact Us</strong> <br>You can get customer service assistance via the [Contact Us] button in the game to help you with any problems you may encounter while playing. You can also find us on the following platforms. We welcome all of your Mobile Legends: Bang Bang thoughts and suggestions:</p>\n<!-- /wp:p