(110,1,"2019-10-25 17:55:35","2019-10-25 17:55:35","<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://i.ytimg.com/vi/_FDzXK3QqCM/maxresdefault.jpg\" alt=\"Image result for darkness rises android game pic\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Darkness Rises is a revolutionary Action RPG that blends gorgeous graphics, innovative game play, and intense boss battles, all within the palm of your hands. Darkness spreads across the land, bringing with it a horde of ferocious demons ready to breach our gates. An epic fantasy RPG awaits - the path will be grueling, </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=T2BoTBSV11E\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=T2BoTBSV11E\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">but you must persevere and descend into hell itself to destroy this evil before it ravages our world. Legendary heroes are at your beck and call, from the earth-shattering Berserker to the magic-wielding Wizard. Character customization lets you choose from a number of classes that fits your play style and design your character as you see fit. Hack and slash through fearsome monsters with a flurry of powerful skills. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=FmzKXfB6o6Q\\u0026t=54s\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"ce