(121,1,"2019-10-25 17:55:35","2019-10-25 17:55:35","<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://i.ytimg.com/vi/_FDzXK3QqCM/maxresdefault.jpg\" alt=\"Image result for darkness rises android game pic\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Darkness Rises is a revolutionary Action RPG that blends gorgeous graphics, innovative game play, and intense boss battles, all within the palm of your hands. Darkness spreads across the land, bringing with it a horde of ferocious demons ready to breach our gates. An epic fantasy RPG awaits - the path will be grueling, </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=T2BoTBSV11E\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=T2BoTBSV11E\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">but you must persevere and descend into hell itself to destroy this evil before it ravages our world. Legendary heroes are at your beck and call, from the earth-shattering Berserker to the magic-wielding Wizard. Character customization lets you choose from a number of classes that fits your play style and design your character as you see fit. Hack and slash through fearsome monsters with a flurry of powerful skills. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=FmzKXfB6o6Q\\u0026t=54s\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=FmzKXfB6o6Q&amp;t=54s\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">Enter the PvP arena and unleash your might against other players. This Epic role playing games pits you against demons and worse can you rise to the challenge? Conquer the darkness before it conquers you. Download now. Key Features: ADVENTURE RPG </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=XgDY5EqwtdE\\u0026t=44s\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=XgDY5EqwtdE&amp;t=44s\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> Hack and slash your way through demons and hordes of monsters</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">  Single player RPG mode lets you face the demonic horde on your own</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=PZJ-O6QMBng\\u0026t=46s\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=PZJ-O6QMBng&amp;t=46s\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">  Explore the various levels of dark dungeons EPIC BOSS FIGHTS  This Role playing games with challenging boss battles that will put your skills to the test</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=cOBxsNIAz18\\u0026t=18s\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube aligncenter wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=cOBxsNIAz18&amp;t=18s\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">   PvE  battles grow more intense as you venture deeper into the abyss BEST RPG EXPERIENCE </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\">  Enjoy epic visuals that will truly immerse you into the world of Darkness Rises </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> Fantasy RPG gameplay mechanics - use the Soul Link ability to seize control of monsters and turn your enemies against themselves </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"> Take legendary heroes on dungeon raids - gather your allies to explore menacing dungeons and discover rare loot</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=UwGGyTRdlxg\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"align\":\"center\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-bl